RenderingEngine={"render":function(log){var c1,c2;for(c1 in log){for(c2 in log[c1]){var item=log[c1][c2];var message=item["message"];var type=item["type"];var clock=item["clock"];var prevClock,clockChanged;if(prevClock!=clock){clockChanged=true;prevClock=clock}else{clockChanged=false}if(clockChanged){RenderingEngine.appendItem("CLOCK: "+clock,"clock_changed")}switch(type){case SystemStateLogTypes.Customer.Enter:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.Customer.GetService:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.Customer.Exit:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.TellerManager.CreateTeller:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.TellerManager.Increase:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.TellerManager.ListFreeTellers:RenderingEngine.appendItem("<p>空闲服务员列表</p>"+message,type);break;break;case SystemStateLogTypes.Teller.StateBusy:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.Teller.StateFree:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.Queue.Log:RenderingEngine.appendItem("<p>顾客队列</p>"+message,type);break;case SystemStateLogTypes.NumberingMachine.Increase:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.SimulationEngine.Start:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.SimulationEngine.Finish:RenderingEngine.appendItem(message,type);break;case SystemStateLogTypes.SimulationEngine.Log:RenderingEngine.appendItem(message,type);break;default:LOG.error("Invalid SystemStateLogTypes passed to rendering engines: "+type);break}}}},"renderedItems":"","appendItem":function(item,htmlclass){this.renderedItems+="\n"+"<li class= '"+htmlclass+"'>"+item+"</li>"+"\n"},"getRenderedOutput":function(){return"<ul>"+this.renderedItems+"</ul>"},"renderQueue":function(queue){var result="";if(!queue.isEmpty()){result="<ol>";var queue_all=queue.getAll();for(var i=0;i<=queue_all.length-1;i++){var customer=queue_all[i];var customerid=customer.customerid;var enterTime=customer.enterTime;result+="<li>";result+="<ul class='inline-ul'>";result+="<li>";result+="<span class='label'>ID</span>";result+="<span class='value'>"+customerid+"</span>";result+="</li>";result+="<li>";result+="<span class='label'>到达时间<span>";result+="<span class='value'>"+enterTime+"</span>";result+="</li>";result+="</ul>";result+="</li>"}result+="</ol>"}else{result+="<p>空</p>"}return result},"renderTellerArray":function(tellerArr){var result="";if(tellerArr.length>0){result="<ul>";for(var i=0;i<=tellerArr.length-1;i++){var teller=tellerArr[i];var tellerid=teller.tellerid;var customerid=teller.customerid;result+="<li>";result+="<ul class='inline-ul'>";result+="<li>";result+="<span class='label'>ID</span>";result+="<span class='value'>"+tellerid+"</span>";result+="</li>";result+="<li>";result+="<span class='label'>顾客ID</span>";result+="<span class='value'>"+customerid+"</span>";result+="</li>";result+="</ul>";result+="</li>"}result+="</ul>"}else{result+="<p>服务员数组为空</p>"}return result}}